import { IoIosSearch } from 'react-icons/io'
import { useState } from 'react'
import { debounce } from 'lodash'
import { Formik, Form, Field, ErrorMessage } from 'formik';
export default function SearchBox({search, setSearch}) {
    const handleChange = debounce( () => console.log(search), 2000)
    return(
        <div className='flex no-wrap h-8 w-2/6 border border-black m-5'>
            <IoIosSearch className='w-8 my-auto'/>
            <Formik initialValues={{search: ''}} onChange={console.log('fired')}>
                <Form>
                    <input className='w-full h-full mx-auto outline-none' type="text" name='search' placeholder='Search Everywhere' value='search'
                    onChange={handleChange} />
                </Form>
            </Formik>
        </div>
    )
}
